import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {

    fetch('http://localhost:8080/images/1')
      .then(response => response.json())
      .then(data => setData(data["image"]))
      .catch(error => console.error('Error fetching data:', error));
  }, []);




  return (
    <div className="App">
      <header className="bg-gradient-to-r from-blue-800 to-indigo-900">
      <div>
      {data && data.url ? (
            <img src={`${process.env.AWS_S3_URL}/${data.url}`} alt="b_image0007.png" />
          ) : (
            <p>Loading...</p> // Affiche un message de chargement pendant le chargement des données
          )}
    </div>
        <p className=''>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
